INSERT INTO public.todos (id,created_at,title,is_complete,user_id) VALUES ('5b27c026-179b-556d-aaa9-42b38c28f620', DEFAULT, 'Et gloriatur veritiam es exis nihilla et quam, et quam laudatest vexet sine nec.', DEFAULT, NULL), ('9c0761f5-476e-558a-80d1-e1dc095d8ca8', DEFAULT, 'In dialecorum gravisti prospexit glorios primum docen de.', DEFAULT, NULL), ('d717aabd-38e0-50f2-bbdc-a6c8411afaf8', DEFAULT, 'Est im omistime duris quae anium.', DEFAULT, NULL), ('25cac768-72c6-55cd-b7f4-a1de764ed824', DEFAULT, 'Quidem quod ilest uta tibus.', DEFAULT, NULL), ('f431610f-381e-534b-b78c-c8e53d196e8c', DEFAULT, 'Iudicur si rerum nec d.', DEFAULT, NULL), ('af768de8-cfb5-5c65-876e-91af1461904f', DEFAULT, 'Sit inest est virtutem nullo acceditur non, inqueret naturus didiciore efficiat esse ipsis in eptrice.', DEFAULT, NULL), ('d36cb735-4512-5713-9527-df63793b9849', DEFAULT, 'Effecta consecum numerem ur iuberiuste sit mentitiam autem.', DEFAULT, NULL), ('ed428dc7-8403-53ab-9ed7-43997ed9c45b', DEFAULT, 'Albucius tam et depravat voluptates.', DEFAULT, NULL), ('529b5fde-6571-575a-ace0-f657a7c46713', DEFAULT, 'Adopin sit recteque neque maledonium multam ea quocire.', DEFAULT, NULL), ('301c9bd9-8f50-5f40-936f-edeac13a3af3', DEFAULT, 'Offendit sempermandam ea intus suo.', DEFAULT, NULL), ('c5d9296a-e225-5955-a49b-9a4219c03cc0', DEFAULT, 'Andi inquam sed currunt delectitur.', DEFAULT, NULL), ('979fc471-08e3-5ec4-97fe-c4752380f33d', DEFAULT, 'Posse fecerat nec etur in quisquam.', DEFAULT, NULL), ('5e28d4cf-13a2-5116-bfa1-5cf3e928c49d', DEFAULT, 'Sapiendi quid cum dolorem quae il doloriantur facitur, quo ne darem ophorrent tam.', DEFAULT, NULL), ('689caceb-e077-500a-9545-eab6a54eacc2', DEFAULT, 'Statim atque ipsummum dis atest per, eum de nostrum si inandisput alique est ad.', DEFAULT, NULL), ('fa794225-44ad-5f55-afb6-8bcb93f4beba', DEFAULT, 'Iucuna non putam non vitamor appellant libid omni, me quam ut nis iudicare factis.', DEFAULT, NULL), ('79e66388-20b1-5953-951f-52d5b723ecf7', DEFAULT, 'Se illa et poetis ulum ob epicitur, endum omisfacil numquam quodsi alia.', DEFAULT, NULL), ('472351de-9aed-575f-ae8b-4e4775ad89a4', DEFAULT, 'Quae nullam mihi reprehens iis vituptate ullam, ut delicem tractatem doctus rerum quisquam legamicul.', DEFAULT, NULL), ('a4f14b33-1daa-58c3-abc7-4e5bd4b5effa', DEFAULT, 'Sed ut optabil dicem magnis migraretiam si.', DEFAULT, NULL), ('88c31fec-1f6e-5639-99b3-8e7bc1fa4f75', DEFAULT, 'Inquam quaedam aut sumus pendere omos ob tum.', DEFAULT, NULL), ('facfcda9-761a-5510-8906-be89e814620e', DEFAULT, 'Non quod necesse tot exeamus.', DEFAULT, NULL);
